var title_f1_15_1276="Funct level scale for Meniere disease";
var content_f1_15_1276=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F72837&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F72837&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Functional level scale for Meniere disease",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Regarding my current state of overall function, not just during attacks (check the ONE that best applies):",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. My dizziness has no effect on my activities at all.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. When I am dizzy I have to stop what I am doing for a while, but it soon passes and I can resume activities. I continue to work, drive, and engage in any activity I choose without restriction. I have not changed any plans or activities to accommodate my dizziness.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. When I am dizzy I have to stop what I am doing for a while, but it does pass and I can resume activities. I continue to work, drive, and engage in most activities I choose, but I have had to change some plans and make some allowance for my dizziness.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. I am able to work, drive, travel, take care of a family, or engage in most essential activities, but I must exert a great deal of effort to do so. I must constantly make adjustments in my activities and budget my energies. I am barely making it.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        5. I am unable to work, drive, or take care of a family. I am unable to do most of the active things that I used to. Even essential activities must be limited. I am disabled.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        6. I have been disabled for 1 year or longer and/or I receive compensation (money) because of my dizziness or balance problem.",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Committee on Hearing and Equilibrium guidelines for the diagnosis and evaluation of therapy in Meniere's disease. American Academy of Otolaryngology-Head and Neck Foundation, Inc. Otolaryngol Head Neck Surg 1995; 113:181. Copyright &copy;1995 American Academy of Otolaryngology-Head and Neck Surgery.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
